export default function Chart(props) {

  let element = props.DataSet.map((item, index) => {

    return (
      <div className='chart' key={index}>
        <p>Category: {item.info.category}</p>
        <p>Count: {item.info.satcount}</p>
      </div>

    );
  });
  var list = [];
    for(var i = 0; i < props.DataSet.length ; i++){
    let object = {
        Category: "",
        Count: 0,
    }
    object.Category = props.DataSet[i].info.category;
    object.Count = props.DataSet[i].info.satcount;
    list.push(Object.values(object));
